import React from 'react'

const Comment = ({comments}) => {
  // console.log("comm", comments)
    return(
      <div>
        <div className="loaded-comments">
          {comments && comments.map((comment) => {
            console.log("comm", comment)
            return(
              <div>
                <span className="card-title grey-text text-darken-4"> {comment.comment} <i className="material-icons right">close</i> </span>
                <p> <span className="commentor"> Joe </span> Beautiful!! </p>
              </div>
            )
          })}
        </div>
      </div>
    )
}

export default Comment
